import React from "react";
import Logo from "./Logo";

const Header = () => {

  let companyName = "DNT";
  const companyAddress = <h4>BKK</h4>;
  let num = 10;

  const showMessage = () => {
    return companyName + ".com";
  };

  const isLogin = false;

  return (
    <div>
      <h1>บริษัท {companyName}</h1>
      {companyAddress}
      {showMessage()}
      { isLogin === true && (
        <>
            <p>Welcome</p>
            <p>Welcome 3</p>
        </>
      )}
      { isLogin ? (
          <Logo/>
      ) : (
          <p>No logo</p>
      )} 
      <br />
      {num + 50}
    </div>
  );
};

export default Header;
